import logo from './logo.svg';
import './App.css';
import { row_list } from './Components/Row_List/row_list';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <row_list />
    </div>
  );
}

export default App;
